        return (
            <div class="nav-content center">
                <ul class="tabs">
                    <li class="tab"><a href="#test1">Buy</a></li>
                    <li class="tab"><a class="active" href="#test2">Sell</a></li>
                    <li class="tab"><a href="#test3">Pool</a></li>
                </ul>
            </div>
        );
    }
} */

class Page extends React.Component {
    render() {
        return (
            <div>
                <NavBar />
                <Container />
            </div>
        );
    }
}

ReactDOM.render(<Page />, document.getElementById("root"));
